const HomePage = () => {
  return (
    <div>
      <Navbar />
      <div>
      <div class="banner-cont"><h1>More than <span>1 million businesses</span> manage their work with Zoho Projects.</h1><h4>Follow the crowd. Do yourself proud.</h4><p><a href="/projects/signup.html" class="cta-btn act-btn" style="opacity: 1; visibility: visible;">sign up now</a></p></div>
        <Link to="/login" className="login-link">Login</Link>
      </div>
    </div>
  );
};

export default HomePage;
